import React, { useState,useEffect } from 'react';
import { render } from 'react-dom';
import { AgGridColumn, AgGridReact } from 'ag-grid-react';
import 'ag-grid-enterprise';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

const DataGrid = () => {
    const [gridApi, setGridApi] = useState(null);
    const [gridColumnApi, setGridColumnApi] = useState(null);
    const [rowData, setRowData] = useState([]);

    // const [rowData, setRowData] = useState([
    //     { make: "Toyota", model: "Celica", price: 35000 },
    //     { make: "Ford", model: "Mondeo", price: 32000 },
    //     { make: "Porsche", model: "Boxter", price: 72000 }
    // ]);

    const onGridReady = (params) => {
        setGridApi(params.api);
        setGridColumnApi(params.columnApi);

        const updateData = (data) => {
          setRowData(data);
        };
        fetch('https://www.ag-grid.com/example-assets/olympic-winners.json')
        .then((resp) => resp.json())
        .then((data) => updateData(data));
    };    

    useEffect(() => {
        fetch('https://www.ag-grid.com/example-assets/row-data.json')
        .then(result => result.json())
        .then(rowData => setRowData(rowData))
    }, []);

    const onButtonClick = e => {
        const selectedNodes = gridApi.getSelectedNodes()
        const selectedData = selectedNodes.map( node => node.data )
        const selectedDataStringPresentation = selectedData.map( node => `${node.make} ${node.model}`).join(', ')
        alert(`Selected nodes: ${selectedDataStringPresentation}`)
    }

    // return (
    //     <div className="ag-theme-alpine" style={{ height: 400, width: 600 }}>
    //         <button onClick={onButtonClick}>Get selected rows</button>
    //         <AgGridReact
    //             rowData={rowData} rowSelection="multiple" onGridReady={ params => setGridApi(params.api) }>
    //             <AgGridColumn field="make" sortable={ true } filter={ true } checkboxSelection={ true }></AgGridColumn>
    //             <AgGridColumn field="model" sortable={ true } filter={ true }></AgGridColumn>
    //             <AgGridColumn field="price" sortable={ true } filter={ true }></AgGridColumn>
    //         </AgGridReact>
    //     </div>
    // );
    return (
        <div style={{ width: '100%', height: '100%' }}>
          <div style={{ height: '100%', boxSizing: 'border-box' }}>
            <div
              id="myGrid"
              style={{
                height: '100%',
                width: '100%',
              }}
              className="ag-theme-alpine"
            >
              <AgGridReact
                defaultColDef={{
                  width: 150,
                  editable: true,
                  filter: 'agTextColumnFilter',
                  floatingFilter: true,
                  resizable: true,
                }}
                defaultColGroupDef={{ marryChildren: true }}
                columnTypes={{
                  numberColumn: {
                    width: 130,
                    filter: 'agNumberColumnFilter',
                  },
                  medalColumn: {
                    width: 100,
                    columnGroupShow: 'open',
                    filter: false,
                  },
                  nonEditableColumn: { editable: false },
                  dateColumn: {
                    filter: 'agDateColumnFilter',
                    filterParams: {
                      comparator: function (filterLocalDateAtMidnight, cellValue) {
                        var dateParts = cellValue.split('/');
                        var day = Number(dateParts[0]);
                        var month = Number(dateParts[1]) - 1;
                        var year = Number(dateParts[2]);
                        var cellDate = new Date(year, month, day);
                        if (cellDate < filterLocalDateAtMidnight) {
                          return -1;
                        } else if (cellDate > filterLocalDateAtMidnight) {
                          return 1;
                        } else {
                          return 0;
                        }
                      },
                    },
                  },
                }}
                rowSelection="multiple" onGridReady={ params => setGridApi(params.api) }
              >
                <AgGridColumn headerName="Athlete" field="athlete" />
                <AgGridColumn headerName="Sport" field="sport" />
                <AgGridColumn headerName="Age" field="age" type="numberColumn" />
                <AgGridColumn headerName="Year" field="year" type="numberColumn" />
                <AgGridColumn
                  headerName="Date"
                  field="date"
                  type={['dateColumn', 'nonEditableColumn']}
                  width={220}
                />
                <AgGridColumn headerName="Medals" groupId="medalsGroup">
                  <AgGridColumn headerName="Gold" field="gold" type="medalColumn" />
                  <AgGridColumn
                    headerName="Silver"
                    field="silver"
                    type="medalColumn"
                  />
                  <AgGridColumn
                    headerName="Bronze"
                    field="bronze"
                    type="medalColumn"
                  />
                  <AgGridColumn
                    headerName="Total"
                    field="total"
                    type="medalColumn"
                    columnGroupShow="closed"
                  />
                </AgGridColumn>
              </AgGridReact>
            </div>
          </div>
        </div>
      );
};

//export default DataGrid;
render(<DataGrid></DataGrid>, document.querySelector('#root'));
